BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "comuna" (
	"id"	INTEGER NOT NULL UNIQUE,
	"nombre"	TEXT NOT NULL,
	"codigo"	TEXT NOT NULL UNIQUE,
	"created"	TEXT NOT NULL,
	"updated"	TEXT NOT NULL,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "barrio" (
	"id"	INTEGER NOT NULL UNIQUE,
	"nombre"	TEXT NOT NULL,
	"codigo"	TEXT NOT NULL UNIQUE,
	"estrato"	TEXT NOT NULL,
	"id_comuna"	INTEGER NOT NULL,
	"created"	TEXT NOT NULL,
	"updated"	TEXT NOT NULL,
	FOREIGN KEY("id_comuna") REFERENCES "comuna"("id"),
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "vereda" (
	"id"	INTEGER NOT NULL UNIQUE,
	"nombre"	TEXT NOT NULL,
	"codigo"	TEXT NOT NULL UNIQUE,
	"created"	TEXT NOT NULL,
	"updated"	TEXT NOT NULL,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "sector" (
	"id"	INTEGER NOT NULL UNIQUE,
	"nombre"	TEXT NOT NULL,
	"codigo"	TEXT NOT NULL UNIQUE,
	"id_vereda"	INTEGER NOT NULL,
	"created"	TEXT NOT NULL,
	"updated"	TEXT NOT NULL,
	PRIMARY KEY("id" AUTOINCREMENT),
	FOREIGN KEY("id_vereda") REFERENCES "vereda"("id")
);
CREATE TABLE IF NOT EXISTS "areaexp" (
	"id"	INTEGER NOT NULL UNIQUE,
	"nombre"	TEXT NOT NULL,
	"codigo"	TEXT NOT NULL UNIQUE,
	"created"	TEXT NOT NULL,
	"updated"	TEXT NOT NULL,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "areapro" (
	"id"	INTEGER NOT NULL UNIQUE,
	"nombre"	TEXT NOT NULL,
	"codigo"	TEXT NOT NULL UNIQUE,
	"created"	TEXT NOT NULL,
	"updated"	TEXT NOT NULL,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "tangara" (
	"id"	INTEGER NOT NULL UNIQUE,
	"mac"	TEXT NOT NULL UNIQUE,
	"geohash"	TEXT NOT NULL,
	"codigo"	TEXT NOT NULL UNIQUE,
	"latitud"	TEXT NOT NULL,
	"longitud"	TEXT NOT NULL,
	"id_barrio"	INTEGER,
	"id_sector"	INTEGER,
	"id_areaexp"	INTEGER,
	"id_areapro"	INTEGER,
	"online"	BLOB NOT NULL,
	"created"	TEXT NOT NULL,
	"updated"	TEXT NOT NULL,
	PRIMARY KEY("id" AUTOINCREMENT),
	FOREIGN KEY("id_areapro") REFERENCES "areapro"("id"),
	FOREIGN KEY("id_sector") REFERENCES "sector"("id"),
	FOREIGN KEY("id_areaexp") REFERENCES "areaexp"("id"),
	FOREIGN KEY("id_barrio") REFERENCES "barrio"("id")
);
COMMIT;
